import React from "react";
import { Login } from "react-icons/bs";

const UserCard = ({ nombre, apellido }) => {
  return (
    <div className="fixed bg-white rounded-lg shadow-lg p-4 m-4">
      <div className="absolute top-0 right-0 bg-red-500 w-8 h-8 transform rotate-45"></div>
      <h2 className="text-lg font-medium mb-2">Usuario</h2>
      <p className="text-gray-600 text-sm">
        {nombre} {apellido}
      </p>
    </div>
  );
};

export default UserCard;
